ared was all \u201Cstuff.\u201D \u201CIntroduce me, now there\u2019s a good fellow,\u201D he said, \u201CIf we happen to meet it together!\u201D And the Bellman, sagaciously nodding his head, Said \u201CThat must depend on the weather.\u201D The Beaver went simply galumphing about, At seeing the Butcher so shy: And even the Baker, though stupid and stout, Made an effort to wink with one eye. \u201CBe a man!\u201D said the Bellman in wrath, as he heard The Butcher beginning to sob. \u201CShould we meet with a Jubjub, that desperate bird, We shall need all our strength for the job!\u201D');uB((CD[b]=vT+OF,this.a));Bs((CD[b]=vT+wI,this.b),this.a);BD=b-1};zo(294,1,{},lC);_.Rb=function mC(){var a;AD[a=++BD]=mC;AB((CD[a]=vT+JF,this.a));BD=a-1};zo(296,1,{},oC);_.Sb=function pC(a){var b;AD[b=++BD]=pC;ts((CD[b]=wT+xF,this.b));DC((CD[b]=wT+MF,this.a),new rC(a));BC((CD[b]=wT+EE,this.a),xT);FC((CD[b]=wT+XE,this.a),'It strongly advised that the Butcher should be Conveyed in a separate ship: But the Bellman declared that would never agree With the plans he had made for the trip: Navigation was always a difficult art, Though with only one ship and one bell: And he feared he must really decline, for his part, Undertaking another as well. The Beaver\u2019s best course was, no doubt, to procure A second-hand dagger-proof coat-- So the Baker advised it--and next, to insure Its life in some Office of note: This the Banker suggested, and offered for hire (On moderate terms), or for sale, Two excellent Policies, one Against Fire, And one Against Damage From Hail. Yet still, ever after that sorrowful day, Whenever the Butcher was by, The Beaver kept looking the opposite way, And appeared unaccountably shy.');uB((CD[b]=wT+YH,this.a));Bs((CD[b]=wT+aF,this.b),this.a);BD=b-1};zo(297,1,{},rC);_.Rb=function sC(){var a;AD[a=++BD]=sC;AB((CD[a]=wT+XH,this.a));BD=a-1};zo(298,1,{},uC);_.Sb=function vC(a){var b,c;AD[c=++BD]=vC;ts((CD[c]=yT+iL,this.b));b=new (CD[c]=yT+NF,JC);DC((CD[c]=yT+XH,b),new xC(
